ctrl.data.forEach((item) => {

    let valor = item.datapoints.map((d) => d[0]);

    // +--------------------------------------+
    // | Armazenando os HOSTs - CONSULTA A    |
    // +--------------------------------------+
    if (item.alias == "DADOS") {
        //alert(valor);
        for (let i=0;i<valor.length;i++) {

            let dados = String(valor[i]).split("___");

            // Identificando o SWITCH CENTRAL
            if ((dados[1] == 1) && (switchcentral === undefined)) {

                switchcentral = dados[0];
                tipocentral = dados[2].toLowerCase();
                ipcentral = dados[3];
                nomecentral = dados[4];

                //pos++;

            } else if ((switchcentral === undefined) && (dados[2] == "switch")) {
                // Se nao tiver switch central pega o proximo switch com central 
                switchcentral = dados[0];
                tipocentral   = dados[2].toLowerCase();
                ipcentral     = dados[3];
                nomecentral   = dados[4];

                //pos++;

            } else {

                /* define o texto do tipo de equipamento
                    SV -> servidor      AP -> access points     SW -> switch
                */
                if (dados[2].toLowerCase() == 'servidor') {
                    text[dados[0]] = "SV";
                } else if ((dados[2].toLowerCase() == 'ap') || (dados[2].toLowerCase() == 'access point')) {
                    text[dados[0]] = "AP";
                } else {
                    text[dados[0]] = "SW";
                }

                /* define o texto do tipo de equipamento
                    DC -> domain controller     SR -> servidor rede
                */                
                if (dados[1] == 2) {
                    text[dados[0]] = "DC";
                } else if (dados[1] == 3) {
                    text[dados[0]] = "SR";
                }    

                host[dados[0]] = dados[0];

                tipo[dados[0]] = dados[2].toLowerCase();
                ip[dados[0]]   = dados[3];
                nome[dados[0]] = dados[4];
            }


        }    
    }

    // +--------------------------------------+
    // | Armazenando ALARMES - CONSULTA B     |
    // +--------------------------------------+
    if (item.alias === "RILAN") {

        for (let key in valor) {

            let info = valor[key].split('|'); 

            for (let i=0;i<info.length;i++) {


                if (info[i] !== '') {
                    let dados = info[i].split('__');

                    if (dados[3].match("RI_")) {

                        alarme[dados[0]] = dados[1];
                        descricaofalha[dados[0]] = 'Falha: '+dados[2] + '\nChamado: '+dados[3] + '\nData: ' +dados[4];
                    } else if (alarme[dados[0]] === undefined) {

                        alarme[dados[0]] = dados[1];
                        descricaofalha[dados[0]] = 'Falha: '+dados[2] + '\nChamado: Sem informação RI' + '\nData: ' +dados[4];
                    }
                }

            }
        }        
    }

    // +--------------------------------------+
    // | Armazenando REDE   -     CONSULTA C  |
    // +--------------------------------------+
    if (item.alias == "ALIAS") {
        //alert(valor + "---" + item.alias);
        alias = valor;
    }

    // +--------------------------------------+
    // | Armazenando ALARMES - CONSULTA D     |
    // +--------------------------------------+
    if (item.alias === "RIWAN") {

        for (let key in valor) {

            let info = valor[key].split('|'); 

            for (let i=0;i<info.length;i++) {

                if (info[i] !== '') {
                    let dados = info[i].split('__');

                    if (dados[3].match("RI_")) {

                        descricaofalhawan = "\nFalha(s):\n"+dados[3]  + " - " + dados[2];
                        alarmewan = dados[1];
                    } else if ( (!dados[3].match("RI_") &&  descricaofalhawan === '' )) {
                        descricaofalhawan = "\nFalha(s):\n"+dados[3]  + " - " + dados[2];
                        alarmewan = dados[1];
                    }
                    colorrouter = "#FF0000";
                }


            }
        }
    }   


